geregisseerd door John Milton Branton
met Sean Patrick Flanery, Kristanna Loken en Chris Carmack

Tijdens een herverkiezing wordt de burgemeester van een door misdaad geteisterde stad vermoord. 
Doordat de lokale politie ofwel te corrupt ofwel te incompetent is besluit de stad de FBI in te schakelen. 
John Archer en de knappe Mila Driver worden samen op de zaak gezet. 
Ze ontdekken al snel dat het stadhuis meer geheimen herbergt dan de identiteit van de moordenaar.

When the mayor of a crime-ridden city and his opponent are assassinated, two FBI agents 
join forces to investigate the murder and become the targets of a powerful criminal conspiracy.
